import React from "react";

const Clicker = () => {
    const fireLasers = () => {
        console.log("The lasers have been fired");
        console.log("pew pew");
    }
    return (
        <button onMouseOver={fireLasers}>CLICK ME!</button>
    );
}

export default Clicker;
